import React, { Component } from 'react';
import { BrowserRouter, Router } from 'react-router-dom';
import './App.css';
import Skills from './pages/Skills';

class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <Navi></Navi>
        <Row tech={this.state.tech.slice(0, 3)}></Row>
        <Row tech={this.state.tech.slice(3, 6)}></Row>
        <Row tech={this.state.tech.slice(6, 9)}></Row>
        <Row tech={this.state.tech.slice(9, 11)}></Row>

        <Footer></Footer>
      </div>
    );
  }
}

export default App;
